import React from 'react';
import { Card, CardContent, Typography, List, ListItem, ListItemText, CircularProgress } from '@mui/material';

const PredictionResult = ({ prediction, loading }) => {
  if (loading) {
    return (
      <div style={{ display: 'flex', justifyContent: 'center', margin: '20px' }}>
        <CircularProgress />
      </div>
    );
  }

  if (!prediction) return null;

  return (
    <Card sx={{ maxWidth: 600, margin: '20px auto' }}>
      <CardContent>
        <Typography variant="h5" component="div" gutterBottom>
          Vorhersageergebnis
        </Typography>

        <Typography variant="h6" color="text.secondary" gutterBottom>
          Wahrscheinlichkeit f√ºr einen Jobwechsel: {Math.round(prediction.confidence * 100)}%
        </Typography>

        {prediction.recommendations && prediction.recommendations.length > 0 && (
          <>
            <Typography variant="h6" gutterBottom>
              Empfehlungen:
            </Typography>
            <List>
              {prediction.recommendations.map((rec, index) => (
                <ListItem key={index}>
                  <ListItemText primary={rec} />
                </ListItem>
              ))}
            </List>
          </>
        )}
      </CardContent>
    </Card>
  );
};

export default PredictionResult;
